import React from "react";

const Search = (props) => {
  //  console.log(props)
  return (
    // <div className='search-right'>
    // <img src={props.value.img}alt='' className='img'></img><br/>
    //   <b>Name: </b>{props.value.name}<br />
    //   <b>Location: </b>{props.value.location}<br />
    //   <b>Size: </b>{props.value.size}<br />
    //   <b>Price: </b>{props.value.price}

    // </div>

    <div className="card" style={{ width: 30 + "rem" }}>
      <img
        className="card-img-top"
        src={props.value.img}
      />
      <div className="card-body">
        <h1 className="card-title">{props.value.name}</h1>
        <h2 className="card-text">{props.value.location} </h2>
        <h4 className="card-text">{props.value.size} </h4>
        <h4 className="card-text">{props.value.price} </h4>
        <h4 className="card-text">{props.value.description} </h4>
      </div>
    </div>
  );
};
export default Search;
